column8:
★部活やトレーニングに！エレアのピステジャケット！<br>
<br>
●1988年創設イタリアブランド、エレアのジャケット！<br>
●薄く、軽量のため、持ち歩くのに最適！<br>
●プルオーバータイプで、ウエスト部分には調節紐付き！<br>
●袖口にはゴムがあり、激しい動きにもズリ上がりにくい！<br>
●左腕部分にロゴ刺繍入り！<br>
●超撥水効果で、雨も弾く！<br>
●サッカー、フットサルのみならず、様々なスポーツの練習着として使用可能！<br>
<br>
■素材 ポリエステル100％<br>
■企画製造販売元 豊島株式会社<br>
<br>
